import React from 'react'
import '../App.css';
import telegram from './Images/tele_logo.svg'
import insta from './Images/insta_logo.svg'
import youtube from './Images/yt_logo.svg'
import in_logo from './Images/in_logo.svg'
import c1 from './Images/c1.png'
import c2 from './Images/c2.webp'

const Middle = () => {
  return (
    <>
    <div>

    </div>

    </>
  )
}
const Content = () => {
  return (
        <div className='mt-5'>
           <div className='h1 d-flex flex-row'>Let's Start Your</div>
           <div className='h1 text-bold text-primary d-flex justify-content-center'>IIT</div>
           <div className='h1 d-flex flex-row-reverse'>Preparation With IITians</div>
        </div>
  )
}
const Social = () => {
  return (
    <div className="social">
      <div><img className='social_logo' src={in_logo} alt="" /></div>
      <div><img className='social_logo' src={telegram} alt="" /></div>
      <div><img className='social_logo' src={youtube} alt="" /></div>
      <div><img className='social_logo' src={insta} alt="" /></div>
    </div>
  )
}
const Mentee_says = () => {
  return (
    <>
      <div className=' mantees_block'>
        <h1>What Our Mantees Says</h1>
        <Mantee />
      </div>
    </>

  )
}
const Mantee = () => {
  return (

    <>


      <div className='shadow p-3 w-100 mb-5 bg-body rounded'>
        <div className="container">

          <div class="row">
            <div class="col-md-4">
              <h2 className='text-warning'>Ram Rajput</h2>
              <h3 className='text-info'>AIR : 1</h3>
              <div class="row">
                I apologize, but I couldn't find any information or references regarding a class called "tooper" in the context of web development or Bootstrap. It's possible that "tooper" might be a typo or a less commonly used class name.
                If you have any specific details or examples related to the "tooper" class, please provide more information so I can assist you better.
              </div>
            </div>
            <div class="col-md-8">
              <iframe width="560" height="315" src="https://www.youtube.com/embed/Gh1ZtmHWpfA" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share" allowfullscreen></iframe>

            </div>
          </div>
        </div>
      </div>

    </>
  )
}
const MentorBox = () => {
  return (
    <div className="">
      <div className="card-body  ">
        <p className="card-text text-success fs-4">First time for IIT-JAM Aspirants</p>
        <a href="#" className="fw-bold btn btn-primary m-2 fs-4 ">Join Full Time Mentorship</a>
        <a href="#" className="fw-bold  btn btn-success btn-primary m-2 fs-4 ">Book One Time Session</a>
      </div>
    </div>
  )
}

export default Middle
